import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Home from './';
import Product from './Product';

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/home" component={Home} />
        <Route path="/product" component={Product} />
      </Switch>
    </BrowserRouter>
  )
};

export default App;
